CREATE DATABASE /*!32312 IF NOT EXISTS*/`agrecords_db` /*!40100 DEFAULT CHARACTER SET latin1 */ /*!80016 DEFAULT ENCRYPTION='N' */;

USE `agrecords_db`;

/*Table structure for table `tbl_letters` */

DROP TABLE IF EXISTS `tbl_letters`;

CREATE TABLE `tbl_letters` (
  `letterId` varchar(100) NOT NULL,
  `userId` int NOT NULL,
  `letterTitle` varchar(200) NOT NULL,
  `letterType` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `letterDescription` varchar(300) DEFAULT NULL,
  `letterTags` varchar(500) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `letterTo` varchar(200) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `letterFrom` varchar(200) DEFAULT NULL,
  `dateAdded` timestamp NOT NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`letterId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_letters` */

/*Table structure for table `tbl_login` */

DROP TABLE IF EXISTS `tbl_login`;

CREATE TABLE `tbl_login` (
  `username` varchar(50) DEFAULT NULL,
  `userIn` int DEFAULT '0'
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

/*Data for the table `tbl_login` */

insert  into `tbl_login`(`username`,`userIn`) values ('darynne',1);

/*Table structure for table `tbl_pages` */

DROP TABLE IF EXISTS `tbl_pages`;

CREATE TABLE `tbl_pages` (
  `pageId` int NOT NULL AUTO_INCREMENT,
  `letterId` varchar(100) NOT NULL,
  `pageNumber` int NOT NULL,
  `pageImage` longblob NOT NULL,
  PRIMARY KEY (`pageId`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_pages` */

/*Table structure for table `tbl_permissions` */

DROP TABLE IF EXISTS `tbl_permissions`;

CREATE TABLE `tbl_permissions` (
  `permissionId` int NOT NULL AUTO_INCREMENT,
  `permissionName` varchar(100) NOT NULL,
  PRIMARY KEY (`permissionId`)
) ENGINE=InnoDB AUTO_INCREMENT=12 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_permissions` */

insert  into `tbl_permissions`(`permissionId`,`permissionName`) values (1,'viewRSBSA'),(2,'addRSBSA'),(3,'editRSBSA'),(4,'printRSBSA'),(5,'viewUsers'),(6,'addUsers'),(7,'editUsers'),(8,'viewLetters'),(9,'addLetters'),(10,'editLetters'),(11,'printLetters');

/*Table structure for table `tbl_roles` */

DROP TABLE IF EXISTS `tbl_roles`;

CREATE TABLE `tbl_roles` (
  `roleId` int NOT NULL AUTO_INCREMENT,
  `roleName` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  PRIMARY KEY (`roleId`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_roles` */

insert  into `tbl_roles`(`roleId`,`roleName`) values (1,'Admin'),(2,'User'),(3,'Secret');

/*Table structure for table `tbl_tags` */

DROP TABLE IF EXISTS `tbl_tags`;

CREATE TABLE `tbl_tags` (
  `tagId` int NOT NULL AUTO_INCREMENT,
  `tagName` varchar(100) NOT NULL,
  PRIMARY KEY (`tagId`)
) ENGINE=InnoDB AUTO_INCREMENT=7 DEFAULT CHARSET=latin1;

/*Data for the table `tbl_tags` */

insert  into `tbl_tags`(`tagId`,`tagName`) values (1,'RSBSA'),(2,'LGU'),(3,'Department of Agriculture'),(4,'Rice'),(5,'Corn'),(6,'Provincial Office');

/*Table structure for table `tbl_user_permissions` */

DROP TABLE IF EXISTS `tbl_user_permissions`;

CREATE TABLE `tbl_user_permissions` (
  `userId` varchar(20) NOT NULL,
  `permissionId` int NOT NULL
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `tbl_user_permissions` */

insert  into `tbl_user_permissions`(`userId`,`permissionId`) values ('1',1);

/*Table structure for table `tbl_users` */

DROP TABLE IF EXISTS `tbl_users`;

CREATE TABLE `tbl_users` (
  `userId` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci NOT NULL,
  `roleId` varchar(50) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userPhoto` longblob,
  `userFirstname` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userLastname` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userGender` varchar(11) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userContact` varchar(11) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `username` varchar(20) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userPassword` varchar(100) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userActive` varchar(11) CHARACTER SET latin1 COLLATE latin1_swedish_ci DEFAULT NULL,
  `userReg` timestamp NULL DEFAULT CURRENT_TIMESTAMP,
  PRIMARY KEY (`userId`)
) ENGINE=MyISAM DEFAULT CHARSET=latin1;

